TITLE:
  - 'testing kinetic and internal energy of membrane finite elements (checked with analytical solution):'
  - 'patch of 20x20 quad4 membrane finite elements (plane stress, incompressible) with'
  - dirichlet bc prescribing displacements of all nodes resulting in an uniaxial stretch
  - in x-direction and a translation in y-direction
PROBLEM TYPE:
  PROBLEMTYPE: "Structure"
IO:
  STRUCT_STRESS: "Cauchy"
  STRUCT_STRAIN: "GL"
IO/RUNTIME VTK OUTPUT:
  INTERVAL_STEPS: 2
  OUTPUT_DATA_FORMAT: ascii
IO/RUNTIME VTK OUTPUT/STRUCTURE:
  OUTPUT_STRUCTURE: true
  ACCELERATION: true
  OPTIONAL_QUANTITY: "membranethickness"
STRUCTURAL DYNAMIC:
  INT_STRATEGY: "Standard"
  DYNAMICTYPE: "OneStepTheta"
  RESULTSEVERY: 2
  RESEVERYERGY: 2
  RESTARTEVERY: 5
  TIMESTEP: 0.1
  NUMSTEP: 10
  MAXTIME: 1
  LOADLIN: true
  LINEAR_SOLVER: 1
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
SOLVER 1:
  SOLVER: "UMFPACK"
MATERIALS:
  - MAT: 1
    MAT_Membrane_ElastHyper:
      NUMMAT: 1
      MATIDS: [2]
      DENS: 1
  - MAT: 2
    ELAST_IsoNeoHooke:
      MUE: 100
RESULT DESCRIPTION:
  - STRUCTURE:
      SPECIAL: true
      QUANTITY: "internal_energy"
      VALUE: 1.125
      TOLERANCE: 1e-10
  - STRUCTURE:
      SPECIAL: true
      QUANTITY: "kinetic_energy"
      VALUE: 0.005
      TOLERANCE: 1e-10
  - STRUCTURE:
      SPECIAL: true
      QUANTITY: "total_energy"
      VALUE: 1.13
      TOLERANCE: 1e-10
FUNCT1:
  - COMPONENT: 0
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "a*x"
  - COMPONENT: 1
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "b"
  - COMPONENT: 2
    SYMBOLIC_FUNCTION_OF_SPACE_TIME: "0.0"
  - VARIABLE: 0
    NAME: "a"
    TYPE: "multifunction"
    NUMPOINTS: 3
    TIMES: [0, 0.5, 10]
    DESCRIPTION: ["2.0*t", "1.0"]
  - VARIABLE: 1
    NAME: "b"
    TYPE: "multifunction"
    NUMPOINTS: 2
    TIMES: [0, 10]
    DESCRIPTION: ["t"]
DESIGN SURF DIRICH CONDITIONS:
  - E: 1
    NUMDOF: 3
    ONOFF: [1, 1, 1]
    VAL: [1, 1, 1]
    FUNCT: [1, 1, 1]
